INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "ミッションをクリアして、\n報酬をゲットしましょう！", 1, "2030/01/01 14:59:59", 3.099, 190805, -416.5, 62, 0.0, 2, "カリン", 1000002, "2025/01/31 12:00:00", 1);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "受け取ることができる\n報酬があるようです\n確認してみてください", 1, "2030/01/01 14:59:59", 2.801, 190805, -416.5, 63, 0.0, 3, "カリン", 1000003, "2025/01/31 12:00:00", 1);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "報酬がもらえますよ！\nチェックしてみてください", 2, "2030/01/01 14:59:59", 0.0, 190805, -416.5, 63, 0.0, 4, "カリン", 1000004, "2025/01/31 12:00:00", 1);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2, "2030/01/01 14:59:59", 2.12, 190805, -363.0, 64, 0.0, 5, "カリン", 1000005, "2025/01/31 12:00:00", 1);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, "2030/01/01 14:59:59", 1.68, 190805, -363.0, 64, 0.0, 6, "カリン", 1000006, "2025/01/31 12:00:00", 1);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2, "2030/01/01 14:59:59", 2.33, 190805, -363.0, 64, 0.0, 7, "カリン", 1000007, "2025/01/31 12:00:00", 1);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (7, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 3, "2030/01/01 14:59:59", 5.18, 133701, -285.0, 61, -6.0, 101, "ラビリスタ", 1020101, "2025/01/31 12:00:00", 10201);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 1, "2030/01/01 14:59:59", 8.77, 133901, -285.0, 61, -2.0, 201, "クリスティーナ", 1020102, "2025/01/31 12:00:00", 10201);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 6, "2030/01/01 14:59:59", 15.5, 133801, -285.0, 61, 0.0, 301, "ネネカ", 1020103, "2025/01/31 12:00:00", 10201);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (5, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 2, "2030/01/01 14:59:59", 9.061, 134301, -285.0, 61, 0.0, 101, "ランファ", 1020201, "2025/02/28 12:00:00", 10202);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 1, "2030/01/01 14:59:59", 7.699, 134401, -285.0, 61, 0.0, 201, "チカ", 1020202, "2025/02/28 12:00:00", 10202);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 1, "2030/01/01 14:59:59", 8.595, 134601, -285.0, 61, 0.0, 101, "アオイ", 1020301, "2025/03/31 12:00:00", 10203);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 1, "2030/01/01 14:59:59", 7.758, 134501, -285.0, 61, 0.0, 201, "クローチェ", 1020302, "2025/03/31 12:00:00", 10203);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (6, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 2, "2030/01/01 14:59:59", 7.0, 132302, -285.0, 61, 0.0, 101, "ルイズマリー", 1020401, "2025/04/30 12:00:00", 10204);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 1, "2030/01/01 14:59:59", 7.904, 132402, -285.0, 61, 0.0, 201, "イロハ", 1020402, "2025/04/30 12:00:00", 10204);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 4, "2030/01/01 14:59:59", 8.487, 132502, -285.0, 61, 0.0, 301, "ソノ", 1020403, "2025/04/30 12:00:00", 10204);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 1, "2030/01/01 14:59:59", 8.763, 134901, -285.0, 61, 0.0, 101, "カノン", 1020502, "2025/05/31 12:00:00", 10205);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (3, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 1, "2030/01/01 14:59:59", 6.417, 134801, -285.0, 61, 0.0, 201, "ツムギ", 1020503, "2025/05/31 12:00:00", 10205);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (7, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 3, "2030/01/01 14:59:59", 10.335, 135001, -285.0, 61, 0.0, 101, "エリス", 1020601, "2025/06/30 12:00:00", 10206);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (4, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 2, "2030/01/01 14:59:59", 6.281, 135101, -285.0, 61, 0.0, 201, "シェフィ", 1020602, "2025/06/30 12:00:00", 10206);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 1, "2030/01/01 14:59:59", 12.244, 135201, -285.0, 61, 0.0, 301, "プレシア", 1020603, "2025/06/30 12:00:00", 10206);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (8, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 2, "2030/01/01 14:59:59", 6.339, 135301, -285.0, 61, 0.0, 101, "クリア", 1020701, "2025/07/31 12:00:00", 10207);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (9, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 7, "2030/01/01 14:59:59", 8.184, 135401, -285.0, 61, 0.0, 201, "アネモネ", 1020702, "2025/07/31 12:00:00", 10207);
